
public class q13M {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int j=50;
		for(int i=10;i<=100;i=i+10)
		{
			if(i%j==0)
			{
				System.out.println("oh! i got fifty");
				j++;
			}
			else
			{
				System.out.println(i);
			}
		}

	}

}
